import React from 'react';
import { Contextt } from '../App';
import {Route} from 'react-router-dom';
import Post from '../components_new/post/post';
import PostPage from '../components_new/post-page/post-page';
import classes from './PostComponent.module.css';


export default () => {
    return (
        <div> 
            <h1 style={{textAlign:center}}>Posts</h1>
            <div className={classes.posts}>
                <Contextt.Consumer>
                    {
                        (obj) => {
                            return (
                                <div className={classes.one}>
                                {obj.posts.map((v) => 
                                    <Post 
                                        key={v.postId}
                                        id={v.postId}
                                        author={v.author}
                                        date={v.date}
                                        title={v.title}
                                        disc={v.shordDesc}
                                        comments={v.comments}/>
                                )}</div>
                            );

                        }
                    }
                </Contextt.Consumer>

                <div className={classes.two}>
                    <Route path='/posts/:id' component={PostPage}/>
                </div>
            </div>
        </div>
    );
}
